import React from 'react';
import './footer.css';
import { Container,Row,Col } from 'reactstrap';
import {Link} from 'react-router-dom'
import logo from '../../assets/images/logo.png'



const Footer = () => {
  return (
    <footer className="footer">
      <Container>
        <Col></Col>
      </Container>
    </footer>
  )
}

export default Footer
